import Link from 'next/link';
import '../styles/header.scss';
const Header = ()=>
{
    return(
        <div className="Header_Container">
            <div className="Header_Logo">Logo</div>
            <ul>
                <div className="link active">Acceuil</div>
                <div className="link">A propos</div>
                <div className="link">Temoignages</div>
                <div className="link">Contact</div>
                <div className="link">Questions</div>
            </ul>
            <div className="Header_Buttons">
                <button className="Header_subscribe">S'inscrire</button>
                <button className="Header_signin">Se connecter</button>
            </div>
        </div>
    )
}

export default  Header ;
